uitetura renascentistas. Um dos seus pontos turísticos mais emblemáticos é o Duomo, catedral com cúpula de telhas de terracota, projetada por Brunelleschi, e o campanário de Giotto. A Galleria dell'Accademia exibe a escultura \\\"Davi\\\", de Michelangelo. A Galeria Uffizi exibe \\\"O Nascimento de Vénus\\\", de Botticelli, e \\\"A Anunciação\\\" de Da Vinci. Sabe mais em: <a href=\\\"https://pt.wikipedia.org/wiki/Floren%C3%A7a\\\" target=\\\"_blank\\\">WikiPédia</a></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"71f6d063-fc73-452a-a1c8-2a4ce766e2cb\"}],\"header\":\"Florença\"},{\"position\":{\"x\":62,\"y\":58.34125475285171},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Vídeo\",\"loading\":\"A carregar o leitor de vídeo...\",\"noPlayers\":\"Nenhum leitor de vídeo foi encontrado para o formato fornecido.\",\"noSources\":\"Falta fonte do vídeo.\",\"aborted\":\"A reprodução foi cancelada.\",\"networkFailure\":\"Falha de ligação.\",\"cannotDecode\":\"Não foi possível descodificar o ficheiro multimédia.\",\"formatNotSupported\":\"Formato de vídeo não suportado.\",\"mediaEncrypted\":\"Ficheiro multimédia protegido.\",\"unknownError\":\"Erro desconhecido.\",\"invalidYtId\":\"ID do YouTube inválido.\",\"unknownYtId\":\"Não foi possível encontrar o vídeo com o ID fornecido.\",\"restrictedYt\":\"O proprietário deste vídeo não permite que seja incorporado.\"},\"sources\":[{\"path\":\"https://youtu.be/GczP2LNeCpc?feature=shared\",\"mime\":\"video/YouTube\",\"copyright\":{\"license\":\"U\"},\"aspectRatio\":\"16:9\"}]},\"library\":\"H5P.Video 1.6\",\"metadata\":{\"contentType\":\"Vídeo\",\"license\":\"U\",\"title\":\"Nápoles: Os 10 Melhores Lugares para Visitar\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Nápoles: Os 10 Melhores Lugares para Visitar\"},\"subContentId\":\"de7af1d0-f995-415b-86e7-ed2563cf2628\"},{\"params\":{\"text\":\"<p>Nápoles é uma comuna do sul de Itália, da região da Campânia, província de Nápoles, com cerca de 1 000 000 habitantes e com cerca de 4 400 000 habitantes na região metropolitana. Nápoles é a terceira cidade mais populosa da Itália após Roma e Milão e tem a segunda ou terceira maior região metropolitana do país. Descobre mais em: <a href=\\\"https://pt.wikipedia.org/wiki/N%C3%A1poles\\\">Wikipédia</a></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f212a57d-1e2e-4246-bf72-ff5ee022cd4c\"}],\"header\":\"Nápoles\"},{\"position\":{\"x\":51.2,\"y\":90.91254752851711},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Vídeo\",\"loading\":\"A carregar o leitor de vídeo...\",\"noPlayers\":\"Nenhum leitor de vídeo foi encontrado para o formato fornecido.\",\"noSources\":\"Falta fonte do vídeo.\",\"aborted\":\"A reprodução foi cancelada.\",\"networkFailure\":\"Falha de ligação.\",\"cannotDecode\":\"Não foi possível descodificar o ficheiro multimédia.\",\"formatNotSupported\":\"Formato de vídeo não suportado.\",\"mediaEncrypted\":\"Ficheiro multimédia protegido.\",\"unknownError\":\"Erro desconhecido.\",\"invalidYtId\":\"ID do YouTube inválido.\",\"unknownYtId\":\"Não foi possível encontrar o vídeo com o ID fornecido.\",\"restrictedYt\":\"O proprietário deste vídeo não permite que seja incorporado.\"},\"sources\":[{\"path\":\"https://youtu.be/-F6Xt_15wcs?feature=shared\",\"mime\":\"video/YouTube\",\"copyright\":{\"license\":\"U\"},\"aspectRatio\":\"16:9\"}]},\"library\":\"H5P.Video 1.6\",\"metadata\":{\"contentType\":\"Vídeo\",\"license\":\"U\",\"title\":\"Sicília: Os 10 Melhores Lugares para Visitar\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Sicília: Os 10 Melhores Lugares para Visitar\"},\"subContentId\":\"12e454e6-ac6b-4149-824b-7d96c4e20aab\"},{\"params\":{\"text\":\"<p>Sicília, a maior ilha do Mediterrâneo, fica perto do \\\"dedo\\\" da \\\"bota\\\" da Itália. Sua história se reflete em lugares como o Vale dos Templos, as ruínas bem conservadas de 7 templos gregos monumentais em estilo dórico e os mosaicos bizantinos da Cappella Palatina, antiga capela real na capital, Palermo. No extremo leste da Sicília está o Etna, um dos vulcões ativos mais altos da Europa. Sabe mais em: <a href=\\\"https://pt.wikipedia.org/wiki/Sic%C3%ADlia\\\" target=\\\"_blank\\\">WikiPédia</a></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8f551769-7d1f-4f82-95cc-b802b2cc120e\"}],\"header\":\"Sicília\"},{\"position\":{\"x\":48,\"y\":48.10836501901141},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Vídeo\",\"loading\":\"A carregar o leitor de vídeo...\",\"noPlayers\":\"Nenhum leitor de vídeo foi encontrado para o formato fornecido.\",\"noSources\":\"Falta fonte do vídeo.\",\"aborted\":\"A reprodução foi cancelada.\",\"networkFailure\":\"Falha de ligação.\",\"cannotDecode\":\"Não foi possível descodificar o ficheiro multimédia.\",\"formatNotSupported\":\"Formato de vídeo não suportado.\",\"mediaEncrypted\":\"Ficheiro multimédia protegido.\",\"unknownError\":\"Erro desconhecido.\",\"invalidYtId\":\"ID do YouTube inválido.\",\"unknownYtId\":\"Não foi possível encontrar o vídeo com o ID fornecido.\",\"restrictedYt\":\"O proprietário deste vídeo não permite que seja incorporado.\"},\"sources\":[{\"path\":\"https://youtu.be/BitGDzsArnE?feature=shared\",\"mime\":\"video/YouTube\",\"copyright\":{\"license\":\"U\"},\"aspectRatio\":\"16:9\"}]},\"library\":\"H5P.Video 1.6\",\"metadata\":{\"contentType\":\"Vídeo\",\"license\":\"U\",\"title\":\"Roma: Viagem pelos Lugares mais Belos | O que Fazer e Ver na Cidade Eterna\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Roma: Viagem pelos Lugares mais Belos | O que Fazer e Ver na Cidade Eterna\"},\"subContentId\":\"45260cf6-81c9-4a49-b689-dab8c78b871b\"},{\"params\":{\"text\":\"<p>Roma, a capital da Itália, é uma cidade cosmopolita, enorme, com quase 3.000 anos de arte, arquitetura e cultura influentes no mundo todo e à mostra. Ruínas antigas como o Fórum e o Coliseu evocam o poder do antigo Império Romano. A Cidade do Vaticano, sede da Igreja Católica Romana, tem a Basílica de São Pedro e os museus do Vaticano, que abrigam obras-primas como os afrescos da Capela Sistina de Michelângelo. Sabe mais em: <a href=\\\"https://pt.wikipedia.org/wiki/Roma\\\" target=\\\"_blank\\\">WikiPédia</a></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"deea99df-aacd-417b-9618-cf3e0db438e3\"},{\"params\":{\"decorative\":false,\"contentName\":\"Imagem\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/4QAqRXhpZgAASUkqAAgAAAABADEBAgAHAAAAGgAAAAAAAABHb29nbGUAAP/bAIQAAwICCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoICAoKCAoICgoICAoKCgoICggICgoICAgKCgoICgsNCgoNCAgKCAEDBAQGBQYKBgYKDw0KDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0N/8AAEQgB/gGRAwERAAIRAQMRAf/EAB0AAAICAwEBAQAAAAAAAAAAAAUGBAcCAwgBAAn/xABcEAACAgADBgMEBwQFBgwDAw0BAgMRBBIhAAUGEyIxB0FRFDJhcQgjQoGRofBSscHRJDNi4fEVFkNTcpIJFzRUY4KTlKKy0tMYc9REVYPC4uMls8PV8jVFhZWj/8QAGwEAAgMBAQEAAAAAAAAAAAAAAgMAAQQFBgf/xAA4EQACAgEDAwMCBAYCAQQDAQAAAQIRAxIhMQRBURMiYTJxBYGRoRRCscHR8FLhIwYVM4IWcvFi/9oADAMBAAIRAxEAPwDvSeLb2kZHDYNxF7PFkLeO7bF/DYk+wuUb3FvEabMMrIUsexoWzLD6bUy0FYYgRsA1I95VbUyyfhFsVtAkbpd3mtNoFQC3jFWxIRNGndW8TdHY2gIyCEstG/LZY1sKYM3qNoM
